social_posts.post_text:
Well that’s a wrap @rupaulsdragcon LA 2023! It was my first time and you sure made it feel special. So many memories and friends made. I’ll post more later but I had to share this moment walking the @cashapp Pink Carpet. This look was designed and created, head to toe, BY ME 🥹 I was inspired to bring all of my alter egos to the runway. A little Leather Daddy, a little Luchador, and a lot of Pokémon. My mother, @roushellz, would sew everyone’s Black History looks, so in some way it is a tribute to her was well on this Mother’s Day. The “I can do it” attitude. The “I’m gonna learn a new skill” mentality. The “show up & show out” approach to life. I owe it all to her. So grateful to finally feel confident but also receive the love from so many. Thank you from the bottom of my bunny heart. We’re all born naked and the rest is Drag…Con 🖤🐰💛🫶🏾

